import React  from 'react';
import Button  from 'react-bootstrap/esm/Button';
import ThemeContext from "./context"

let  toggle = () => {
      return (
        <ThemeContext.Consumer>
            {({theme}) => {
                <>
                    <Button onClick={theme.change} variant="primary">
                        chnage color
                    </Button>
                </>
            }}
        </ThemeContext.Consumer>
      )
}

export default toggle
